Skin configuration] for information how to enable them and choose the default.\n\n$2\n\n; If you have just installed MediaWiki:\n: You probably installed from git, or directly from the source code using some other method. This is expected. Try installing some skins from [https://www.mediawiki.org/wiki/Category:All_skins mediawiki.org\'s skin directory], by:\n:* Downloading the [https://www.mediawiki.org/wiki/Download tarball installer], which comes with several skins and extensions. You can copy and paste the <code>skins/</code> directory from it.\n:* Cloning one of the <code>mediawiki/skins/*</code> repositories via git into the <code dir=\"ltr\">skins/</code> directory of your MediaWiki installation.\n: Doing this should not interfere with your git repository if you\'re a MediaWiki developer.\n\n; If you have just upgraded MediaWiki:\n: MediaWiki 1.24 and newer no longer automatically enables installed skins (see [https://www.mediawiki.org/wiki/Manual:Skin_autodiscovery Manual: Skin autodiscovery]). You can paste the following lines into <code>LocalSettings.php</code> to enable all currently installed skins:\n\n<pre dir=\"ltr\">$3</pre>\n\n; If you have just modified <code>LocalSettings.php</code>:\n: Double-check the skin names for typos.\";'),('en','messages:default-skin-not-found-no-skins','s:1095:\"Whoops! The default skin for your wiki, defined in <code>$wgDefaultSkin</code> as <code>$1</code>, is not available.\n\nYou have no installed skins.\n\n; If you have just installed or upgraded MediaWiki:\n: You probably installed from git, or directly from the source code using some other method. This is expected. MediaWiki 1.24 and newer doesn\'t include any skins in the main repository. Try installing some skins from [https://www.mediawiki.org/wiki/Category:All_skins mediawiki.org\'s skin directory], by:\n:* Downloading the [https://www.mediawiki.org/wiki/Download tarball installer], which comes with several skins and extensions. You can copy and paste the <code>skins/</code> directory from it.\n:* Cloning one of the <code>mediawiki/skins/*</code> repositories via git into the <code dir=\"ltr\">skins/</code> directory of your MediaWiki installation.\n: Doing this should not interfere with your git repository if you\'re a MediaWiki developer. See [https://www.mediawiki.org/wiki/Manual:Skin_configuration Manual: Skin configuration] for information how to enable skins and choose the default.\n\";'),('en','messages:default-skin-not-found-row-enabled','s:32:\"* <code>$1</code> / $2 (enabled)\";'),('en','messages:default-skin-not-found-row-disabled','s:39:\"* <code>$1</code> / $2 (\'\'\'disabled\'\'\')\";'),('en','messages:mediastatistics','s:16:\"Media statistics\";'),('en','messages:mediastatistics-summary','s:138:\"Statistics about uploaded file types. This only includes the most recent version of a file. Old or deleted versions of files are excluded.\";'),('en','messages:mediastatistics-nfiles','s:8:\"$1 ($2%)\";'),('en','messages:mediastatistics-nbytes','s:40:\"{{PLURAL:$1|$1 byte|$1 bytes}} ($2; $3%)\";'),('en','messages:mediastatistics-table-mimetype','s:9:\"MIME type\";'),('en','messages:mediastatistics-table-extensions','s:19:\"Possible extensions\";'),('en','messages:mediastatistics-table-count','s:15:\"Number of files\";'),('en','messages:mediastatistics-table-totalbytes','s:13:\"Combined size\";'),('en','messages:mediastatistics-header-unknown','s:7:\"Unknown\";'),('en','messages:mediastatistics-header-bitmap','s:13:\"Bitmap images\";'),('en','messages:mediastatistics-header-drawing','s:24:\"Drawings (vector images)\";'),('en','messages:mediastatistics-header-audio','s:5:\"Audio\";'),('en','messages:mediastatistics-header-video','s:6:\"Videos\";'),('en','messages:mediastatistics-header-multimedia','s:10:\"Rich media\";'),('en','messages:mediastatistics-header-office','s:6:\"Office\";'),('en','messages:mediastatistics-header-text','s:7:\"Textual\";'),('en','messages:mediastatistics-header-executable','s:11:\"Executables